import React from 'react'
const Navbar = () => {
  const isLogin = false ; 
  if(!isLogin)
  {
    return (
      <div>
        <div class="navbar mx-16 my-2 flex flex-row justify-between items-end">
        <div class="text-2xl font-bold text-black">
          Online Book <br/> 
          Thrift Store
        </div>
  
        <div class="my-3 flex flex-row space-x-5 font-thin">
          <a href='/' class="hover:text-blue-500 hover:cursor-pointer"> Home </a>
          <a href='/buy'    class="hover:text-blue-500 hover:cursor-pointer"> Buy </a>
          <a href='/sell'   class="hover:text-blue-500 hover:cursor-pointer"> Sell</a>
          <a href='/login'   class="hover:text-blue-500 hover:cursor-pointer"> Login </a>
          <a href='/sign-up'       class="hover:text-blue-500 hover:cursor-pointer"> Sign Up</a>
  
        </div>
      </div>
      <hr class="mx-16" />
      </div>
    )
  }
  else
  {
    return (
      <div> You are not login </div>
    )
  }
  
}

export default Navbar
